import React from 'react';

import { Footer, Blog, Possibilty, Features, WhatGPT3, Header } from './containers';
import { CTA, Brand, Navbar } from './components';

const App = () => {
    return (
        <div>
            <div className='App'>
                <div className='gradient__bg'>
                    <Navbar />
                    <Header />
                </div>
                <Brand />
                <WhatGPT3 />
                <Features />
                <Possibilty />
                <CTA />
                <Footer />
            </div>
        </div>
    )
}

export default App
